import React, {Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';


class createBookmark extends Component {
    constructor(props) {
        super(props);
        this.handleSubmit = this.handleSubmit.bind(this);
    }
    handleSubmit(event){
        event.preventDefault();
        const bookmark = {
            "name": document.getElementById("name").value,
            "rating": document.getElementById("rating").value,


        };
        fetch('/bookmarks/create', {
            method: 'post',
            headers: {'Content-Type':'application/json'},
            body: JSON.stringify(bookmark)
        });
    }

    render(){
        return(<div className="container text-center my-3">
            <div className="col-md-6">
                <form className="align-content-center">
                    <div className="form-group">
                        <input type="text" className="form-control" id="name" aria-describedby="Bookmark Name" placeholder="Bookmark Name"/>
                    </div>
                    <button type="submit" onClick={this.handleSubmit} className="btn btn-primary ">Create</button>
                </form>
            </div>
        </div>)
    }
}
export default createBookmark;
